import React from "react";
import { Row, Col, Form } from "react-bootstrap";

function FullTime() {
  return (
    <Row className="my-2">
      <Form>
        <Col sm={12} className="form-group mb-3">
          <label htmlFor="jobTitle" className="required">
            Job Title
          </label>
          <input
            type="text"
            placeholder="Enter your Job Title"
            autoComplete="off"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />
          <p class="fs-7 text-danger">
            * Make sure the Job title is correct and it is not editable{" "}
          </p>

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="salary" className="required">
            Salary
          </label>
          <select
            defaultValue={""}
            aria-label="Salary"
            className="form-select form-select-sm"
            // onChange={locationChangeHandler}
            // onBlur={locationBlurHandler}
          >
            <option value="MYR 1000 and Below">MYR 1000 and Below</option>
            <option value="MYR 1001 to MYR 2000">MYR 1001 to MYR 2000</option>
            <option value="MYR 2001 and MYR 3000">MYR 2001 and MYR 3000</option>
            <option value="MYR 3001 and MYR 4000">MYR 3001 and MYR 4000</option>
            <option value="MYR 4001 and MYR 5000">MYR 4001 and MYR 5000</option>
            <option value="MYR 5001 and Above">MYR 5001 and Above</option>
          </select>

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="location" className="required">
            Location
          </label>
          <input
            type="text"
            placeholder="Please choose your location"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Experience
          </label>
          <input
            type="num"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Education
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Field of Study
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Nationality
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Interview Option
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>

        <Col sm={12} className="form-group mb-3">
          <label htmlFor="fullName" className="required">
            Job Requirement / Responsibility
          </label>
          <input
            type="text"
            placeholder="Enter your Contact Number"
            className="form-control form-control-sm"
            // className={nameClasses}
            // onChange={nameChangeHandler}
            // onBlur={nameBlurHandler}
            // value={enteredPhone}
          />

          {/* {nameInputHasError && (
      <Form.Control.Feedback type="invalid">
        Please fill in person-in-charge name.
      </Form.Control.Feedback>
    )} */}
        </Col>
      </Form>
    </Row>
  );
}

export default FullTime;
